import React from 'react'
import { Navigate, useNavigate } from 'react-router-dom'
import People from './People'
import classes from './sideBar.module.css'


export default function SideBar() {
  const navigate = useNavigate()
  const OnClick = () => {
    navigate('/people')
  }
  return (
    <>
    <div>
      <nav >
        <ul>
            <li onClick={()=>{
              navigate('/dashboard')
            }}>Dashboard</li>
            <li onClick={OnClick}>People</li>
            <li onClick={()=>{
              navigate('/addPeople')
            }}>Add People</li>
        </ul>
      </nav>
    </div>
    {/* <h1 className={classes.people}>People</h1> */}
    </>

  )
}
